webpackJsonp([0x9754afe39f0],{2301:function(e,o){e.exports={pathContext:{docHtml:'<h2>3.0.1</h2>\n<ul>\n<li>Add <code>format</code> to <code>options</code> to allow user-specified formatting following winston@3 conventions (<a href="https://github.com/bithavoc/express-winston/pull/190">#190</a>, @crellison)</li>\n</ul>\n<h2>3.0.0</h2>\n<p>express-winston@3 shouldn\'t have any breaking changes <em>of its own</em>, but there are breaking changes as a result of upgrading winston and Node.js.</p>\n<p>express-winston@2.6.0 will be the last version to support winston@2.</p>\n<h4>Breaking changes</h4>\n<ul>\n<li>Drop support for winston &#x3C; 3. winston@3 includes quite a few breaking changes. Check their <a href="https://github.com/winstonjs/winston/blob/master/CHANGELOG.md">changelog</a> and <a href="https://github.com/winstonjs/winston/blob/master/UPGRADE-3.0.md">upgrade guide</a> to get an idea of winston\'s breaking changes.</li>\n<li>Drop support for Node.js &#x3C; 6. v6 is the oldest version of Node.js <a href="https://github.com/nodejs/Release">currently supported by the Node.js team</a>.</li>\n</ul>\n<h2>2.6.0</h2>\n<ul>\n<li>Add <code>exceptionToMeta</code> and <code>blacklistedMetaFields</code> for filtering returned meta\nobject (<a href="https://github.com/bithavoc/express-winston/pull/173">#173</a>, @cubbuk)</li>\n</ul>\n<h2>2.5.1</h2>\n<ul>\n<li>Allow <code>msg</code> to be a function (<a href="https://github.com/bithavoc/express-winston/pull/160">#160</a>, @brendancwood)</li>\n</ul>\n<h2>2.5.0</h2>\n<ul>\n<li>Reduce memory usage (<a href="https://github.com/bithavoc/express-winston/pull/164">#164</a>, @Kmaschta)</li>\n</ul>\n<h2>2.4.0</h2>\n<ul>\n<li>Allow <code>options.level</code> to be a function for dynamic level setting (<a href="https://github.com/bithavoc/express-winston/pull/148">#148</a>, @CryptArchy)</li>\n</ul>\n<h2>2.3.0</h2>\n<ul>\n<li>Allow line breaks inside <code>msg</code> interpolation (<a href="https://github.com/bithavoc/express-winston/pull/143">#143</a>, @ltegman)</li>\n</ul>\n<h2>2.2.0</h2>\n<ul>\n<li>Add dynamic metadata support to error logger (<a href="https://github.com/bithavoc/express-winston/issues/139">#139</a>, @scarlettsteph)</li>\n</ul>\n<h2>2.1.3</h2>\n<ul>\n<li>Re-enable logging of req.body when request whitelist contains body and there is no no body whitelist/blacklist (broken in 2.1.1) (<a href="https://github.com/bithavoc/express-winston/issues/136">#136</a>)</li>\n</ul>\n<h2>2.1.2</h2>\n<ul>\n<li>Fix error throwing when no req is logged (<a href="https://github.com/bithavoc/express-winston/issues/130">#130</a>)</li>\n</ul>\n<h2>2.1.1</h2>\n<ul>\n<li>Fix <code>bodyBlacklist</code> not working when <code>requestWhitelist</code> contains <code>body</code> (<a href="https://github.com/bithavoc/express-winston/issues/128">#128</a>, @jacobcabantomski-ct)</li>\n</ul>\n<h2>2.1.0</h2>\n<ul>\n<li>Add dynamic metadata support (<a href="https://github.com/bithavoc/express-winston/issues/124">#124</a>, @jpdelima)</li>\n<li>Add support for <code>colorize</code>-ing status code, no <code>expressFormat</code> required (<a href="https://github.com/bithavoc/express-winston/issues/121">#121</a>)</li>\n</ul>\n<h2>2.0.0</h2>\n<h4>Breaking changes</h4>\n<ul>\n<li>Make winston a peer dependency. <code>npm install --save winston</code> if you haven\'t already.</li>\n<li><code>expressFormat</code> has no color by default. Add <code>colorize: true</code> to express-winston\noptions to enable the previous colorized output. (<a href="https://github.com/bithavoc/express-winston/issues/86">#86</a>)</li>\n<li>Drop support for inherited properties on the object provided to the <code>baseMeta</code> option. This is unlikely to actually break anyone\'s real-world setup.</li>\n</ul>\n<h2>1.4.2</h2>\n<ul>\n<li>Upgrade winston to 1.1 (<a href="https://github.com/bithavoc/express-winston/issues/114">#114</a>)</li>\n</ul>\n<h2>1.4.1</h2>\n<ul>\n<li>Don\'t throw exception on invalid JSON in response body (<a href="https://github.com/bithavoc/express-winston/issues/112">#112</a>)</li>\n</ul>\n<h2>1.4.0</h2>\n<ul>\n<li>Allow custom log level for error logger (<a href="https://github.com/bithavoc/express-winston/pull/111">#111</a>)</li>\n</ul>\n<h2>1.3.1</h2>\n<ul>\n<li>underscore -> lodash (<a href="https://github.com/bithavoc/express-winston/issues/88">#88</a>)</li>\n</ul>\n<h2>1.3.0</h2>\n<ul>\n<li>Allow custom status levels (<a href="https://github.com/bithavoc/express-winston/pull/102">#102</a>)</li>\n<li>Add per-instance equivalents of all global white/blacklists (<a href="https://github.com/bithavoc/express-winston/pull/105">#105</a>)</li>\n<li>Allow user to override module-level whitelists and functions without having to worry about using the right object reference (<a href="https://github.com/bithavoc/express-winston/issues/92">#92</a>)</li>\n</ul>\n<h2>1.2.0</h2>\n<ul>\n<li>Add <code>baseMeta</code> and <code>metaField</code> options (<a href="https://github.com/bithavoc/express-winston/pull/91">#91</a>)</li>\n<li>Document <code>requestFilter</code> and <code>responseFilter</code> options</li>\n<li>Drop support for node 0.6 and 0.8</li>\n</ul>',docPath:"argo-ci/node_modules/express-winston/changelog",proj:"argo-ci"}}}});
